import React, { useEffect, Suspense, lazy } from "react";
import { Routes, Route, Navigate } from "react-router-dom";
import { useDispatch, useSelector } from "react-redux";
import { CircularProgress, Box } from "@mui/material";
import { getCurrentUser } from "./redux/slices/authSlice";

// Layouts
import MainLayout from "./layouts/MainLayout";
import AuthLayout from "./layouts/AuthLayout";

// Trạng thái xác thực
const PrivateRoute = ({ children }) => {
  const { isAuthenticated } = useSelector((state) => state.auth);
  return isAuthenticated ? children : <Navigate to="/login" />;
};

const StudentRoute = ({ children }) => {
  const { isAuthenticated, user } = useSelector((state) => state.auth);
  return isAuthenticated && user?.role === "student" ? (
    children
  ) : (
    <Navigate to={isAuthenticated ? "/dashboard" : "/login"} />
  );
};

const TeacherRoute = ({ children }) => {
  const { isAuthenticated, user } = useSelector((state) => state.auth);
  return isAuthenticated && user?.role === "teacher" ? (
    children
  ) : (
    <Navigate to={isAuthenticated ? "/dashboard" : "/login"} />
  );
};

const AdminRoute = ({ children }) => {
  const { isAuthenticated, user } = useSelector((state) => state.auth);
  return isAuthenticated && user?.role === "admin" ? (
    children
  ) : (
    <Navigate to={isAuthenticated ? "/dashboard" : "/login"} />
  );
};

// Lazily loaded pages
const LoginPage = lazy(() => import("./pages/LoginPage"));
const RegisterPage = lazy(() => import("./pages/RegisterPage"));
const DashboardPage = lazy(() => import("./pages/DashboardPage"));
const ProfilePage = lazy(() => import("./pages/ProfilePage"));
const FaceRegistrationPage = lazy(() => import("./pages/FaceRegistrationPage"));
const TeacherClassesPage = lazy(() => import("./pages/teacher/ClassesPage"));
const TeacherClassDetailPage = lazy(() =>
  import("./pages/teacher/ClassDetailPage")
);
const TeacherAttendancePage = lazy(() =>
  import("./pages/teacher/AttendancePage")
);
const StudentClassesPage = lazy(() => import("./pages/student/ClassesPage"));
const StudentAttendancePage = lazy(() =>
  import("./pages/student/AttendancePage")
);
const AdminUsersPage = lazy(() => import("./pages/admin/UsersPage"));
const AdminClassesPage = lazy(() => import("./pages/admin/ClassesPage"));
const AdminDepartmentsPage = lazy(() =>
  import("./pages/admin/DepartmentsPage")
);
const AdminFacilitiesPage = lazy(() => import("./pages/admin/FacilitiesPage"));
const NotFoundPage = lazy(() => import("./pages/NotFoundPage"));

const App = () => {
  const dispatch = useDispatch();
  const { isAuthenticated, user } = useSelector((state) => state.auth);

  useEffect(() => {
    if (isAuthenticated) {
      dispatch(getCurrentUser());
    }
  }, [dispatch, isAuthenticated]);

  return (
    <Suspense
      fallback={
        <Box
          sx={{
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            height: "100vh",
          }}
        >
          <CircularProgress />
        </Box>
      }
    >
      <Routes>
        {/* Xác thực */}
        <Route element={<AuthLayout />}>
          <Route path="/login" element={<LoginPage />} />
          <Route path="/register" element={<RegisterPage />} />
        </Route>

        {/* Layout chính */}
        <Route element={<MainLayout />}>
          {/* Trang chung */}
          <Route
            path="/"
            element={
              isAuthenticated ? (
                <Navigate to="/dashboard" />
              ) : (
                <Navigate to="/login" />
              )
            }
          />
          <Route
            path="/dashboard"
            element={
              <PrivateRoute>
                <DashboardPage />
              </PrivateRoute>
            }
          />
          <Route
            path="/profile"
            element={
              <PrivateRoute>
                <ProfilePage />
              </PrivateRoute>
            }
          />
          <Route
            path="/register-face"
            element={
              <StudentRoute>
                <FaceRegistrationPage />
              </StudentRoute>
            }
          />

          {/* Trang giáo viên */}
          <Route
            path="/teacher/classes"
            element={
              <TeacherRoute>
                <TeacherClassesPage />
              </TeacherRoute>
            }
          />
          <Route
            path="/teacher/classes/:id"
            element={
              <TeacherRoute>
                <TeacherClassDetailPage />
              </TeacherRoute>
            }
          />
          <Route
            path="/teacher/attendance/:classId/:sessionId"
            element={
              <TeacherRoute>
                <TeacherAttendancePage />
              </TeacherRoute>
            }
          />

          {/* Trang sinh viên */}
          <Route
            path="/student/classes"
            element={
              <StudentRoute>
                <StudentClassesPage />
              </StudentRoute>
            }
          />
          <Route
            path="/student/attendance/:classId"
            element={
              <StudentRoute>
                <StudentAttendancePage />
              </StudentRoute>
            }
          />

          {/* Trang admin */}
          <Route
            path="/admin/users"
            element={
              <AdminRoute>
                <AdminUsersPage />
              </AdminRoute>
            }
          />
          <Route
            path="/admin/classes"
            element={
              <AdminRoute>
                <AdminClassesPage />
              </AdminRoute>
            }
          />
          <Route
            path="/admin/departments"
            element={
              <AdminRoute>
                <AdminDepartmentsPage />
              </AdminRoute>
            }
          />
          <Route
            path="/admin/facilities"
            element={
              <AdminRoute>
                <AdminFacilitiesPage />
              </AdminRoute>
            }
          />
        </Route>

        {/* 404 */}
        <Route path="*" element={<NotFoundPage />} />
      </Routes>
    </Suspense>
  );
};

export default App;
